import {StyleSheet, Text, View, ScrollView } from 'react-native';

export default function Inventory(){
    return(
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
            <Text>Inventory</Text>
        </View>
    )
}
